A continuación, se presenta una implementación del algoritmo Bubble Sort en C:

```c
#include <stdio.h>

void bubbleSort(int arr[], int n) {
    int i, j, temp;
    for (i = 0; i < n-1; i++) {
        for (j = 0; j < n-i-1; j++) {
            if (arr[j] > arr[j+1]) {
                // Swap arr[j] and arr[j+1]
                temp = arr[j];
                arr[j] = arr[j+1];
                arr[j+1] = temp;
            }
        }
    }
}

void printArray(int arr[], int size) {
    int i;
    for (i=0; i < size; i++)
        printf("%d ", arr[i]);
    printf("\n");
}

int main() {
    int arr[] = {64, 34, 25, 12, 22, 11, 90};
    int n = sizeof(arr)/sizeof(arr[0]);
    bubbleSort(arr, n);
    printf("Sorted array: \n");
    printArray(arr, n);
    return 0;
}
```

Este código define una función `bubbleSort` que ordena un arreglo de enteros en orden ascendente. La función `printArray` imprime el arreglo ordenado. En el main, se define un arreglo de enteros y se llama a las funciones `bubbleSort` y `printArray`.

Claro! La función `.map()` en JavaScript es una función de arreglos que itera sobre cada elemento de un arreglo y aplica una función a cada uno de ellos, creando un nuevo arreglo con los resultados.

Aquí hay un ejemplo básico de cómo usar la función `.map()`:

```javascript
let numeros = [1, 2, 3, 4, 5];
let doble = numeros.map(function(numero) {
  return numero * 2;
});

console.log(doble); // [2, 4, 6, 8, 10]
```

En este ejemplo, la función `.map()` itera sobre cada elemento del arreglo `numeros`, multiplica cada elemento por 2 y crea un nuevo arreglo `doble` con los resultados.

También puedes usar flecha para simplificar la función:

```javascript
let doble = numeros.map(numero => numero * 2);
```

Espero que esto te ayude a entender cómo usar la función `.map()` en JavaScript. Si tienes preguntas adicionales, no dudes en preguntar!

Here is a JavaScript function that takes an array of 5 numbers as input and checks if any of the numbers are prime. If a prime number is found, it will be printed to the console.

```javascript
function checkPrime(arr) {
    if (arr.length !== 5) {
        console.error("Array should contain exactly 5 numbers.");
        return;
    }

    for (let i = 0; i < arr.length; i++) {
        let num = arr[i];
        if (num < 2) continue; // numbers less than 2 are not prime

        for (let j = 2; j <= Math.sqrt(num); j++) {
            if (num % j === 0) {
                // not prime
                break;
            }
        }

        // if the loop finished without finding a factor, the number is prime
        if (j > Math.sqrt(num)) {
            console.log(num);
        }
    }
}

// Example usage:
let numbers = [17, 2, 3, 13, 19];
checkPrime(numbers);
```

This function first checks if the array has exactly 5 numbers. Then it iterates through the array, checks if the number is less than 2 (since 2 is the smallest prime number), and if it is, it skips to the next number.

For each number, it checks if there is a factor between 2 and the square root of the number. If it finds a factor, it breaks the loop and moves on to the next number. If it doesn't find a factor, the number is prime, and it logs the number to the console.
